import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import ScrollToTop from "./utils/scrollToTop";
import logo from "./images/humana-logo.svg";
import Home from "./components/Home";
import AdventureDetail from "./components/AdventureDetail";
import { Link } from "react-router-dom";
import "./App.scss";
import pq from "../src/api/fetchPQ";
import aemHeadlessClient from "./aemHeadlessClient";

function App() {
  async function fetchData() {
  const persistentQuery = "humana-sample-tenant/AllPages"
  const response = await aemHeadlessClient.runPersistedQuery(
    persistentQuery,
    null
  );
  // The GraphQL data is stored on the response's data field
  data = response?.data;
  console.log(data)
  }
  fetchData();
  return (
    <Router>
      <ScrollToTop />
      <div className="App">
        <header>
        <Link to={"/"}>
          <img src={logo} className="logo" alt="WKND Logo"/>
        </Link>        
        <hr />
        </header>
        <Routes>
          <Route path='/adventure/:slug' element={<AdventureDetail />}/>
          <Route path="/" element={<Home/>}/>
        </Routes>
      </div>
    </Router>
  );
}

export default App;
